import React from 'react';
import Head from 'next/head';
import OtherLayout from '../components/OtherLayout';

const LeaderShip = () => (
  <>
    <Head>
      <title>Study Board | LeaderShip </title>
    </Head>
    <OtherLayout>
      <div>LeaderSHip </div>
    </OtherLayout>
  </>
);

export default LeaderShip;
